import React, { useState } from "react";

const Signup = () => {
  // ORIGINAL STATE MANAGEMENT - UNCHANGED
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    phone: "",
    password: "",
  });

  const [phoneError, setPhoneError] = useState("");

  // ORIGINAL HANDLE CHANGE - UNCHANGED
  const handleChange = (e) => {
    const { name, value } = e.target;

    if (name === "phone") {
      if (!/^\d*$/.test(value)) {
        setPhoneError("Phone number must contain only digits.");
        return;
      } else if (value.length > 10) {
        setPhoneError("Phone number cannot exceed 10 digits.");
        return;
      } else {
        setPhoneError("");
      }
    }

    setFormData({ ...formData, [name]: value });
  };

  // ORIGINAL SUBMIT HANDLER - UNCHANGED
  const handleSubmit = async (e) => {
    e.preventDefault();

    if (formData.phone.length !== 10) {
      setPhoneError("Phone number must be exactly 10 digits.");
      return;
    }

    const response = await fetch("http://localhost:5000/api/auth/signup", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(formData),
    });

    const data = await response.json();
    alert(data.message);
  };

  // ENHANCED STYLING ONLY
  const styles = {
    container: {
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
      height: "100vh",
      backgroundColor: "#f8f9fa",
      backgroundImage: "linear-gradient(to right, #f5f7fa 0%, #c3cfe2 100%)"
    },
    form: {
      width: "100%",
      maxWidth: "400px",
      padding: "2rem",
      backgroundColor: "white",
      borderRadius: "10px",
      boxShadow: "0 4px 20px rgba(0, 0, 0, 0.1)",
      transition: "all 0.3s ease"
    },
    heading: {
      color: "#2b6cb0",
      marginBottom: "1.5rem",
      textAlign: "center",
      fontSize: "1.8rem",
      fontWeight: "600"
    },
    input: {
      width: "100%",
      padding: "12px 15px",
      marginBottom: "15px",
      borderRadius: "6px",
      border: "1px solid #e2e8f0",
      fontSize: "16px",
      transition: "all 0.2s ease"
    },
    inputFocus: {
      borderColor: "#4299e1",
      boxShadow: "0 0 0 3px rgba(66, 153, 225, 0.2)",
      outline: "none"
    },
    error: {
      color: "#e53e3e",
      fontSize: "14px",
      marginTop: "-10px",
      marginBottom: "15px",
      display: "block"
    },
    button: {
      width: "100%",
      padding: "12px",
      backgroundColor: "#4299e1",
      color: "white",
      border: "none",
      borderRadius: "6px",
      fontSize: "16px",
      fontWeight: "600",
      cursor: "pointer",
      transition: "all 0.2s ease"
    },
    buttonHover: {
      backgroundColor: "#3182ce",
      transform: "translateY(-1px)"
    }
  };

  return (
    <div style={styles.container}>
      <form 
        onSubmit={handleSubmit} 
        style={styles.form}
        onMouseEnter={e => e.currentTarget.style.boxShadow = "0 8px 25px rgba(0, 0, 0, 0.12)"}
        onMouseLeave={e => e.currentTarget.style.boxShadow = "0 4px 20px rgba(0, 0, 0, 0.1)"}
      >
        <h2 style={styles.heading}>Sign Up</h2>
        
        <input
          type="text"
          name="name"
          placeholder="Name"
          onChange={handleChange}
          required
          style={styles.input}
          onFocus={e => e.target.style = {...styles.input, ...styles.inputFocus}}
          onBlur={e => e.target.style = styles.input}
        />
        
        <input
          type="email"
          name="email"
          placeholder="Email"
          onChange={handleChange}
          required
          style={styles.input}
          onFocus={e => e.target.style = {...styles.input, ...styles.inputFocus}}
          onBlur={e => e.target.style = styles.input}
        />
        
        <input
          type="text"
          name="phone"
          placeholder="Phone"
          value={formData.phone}
          onChange={handleChange}
          required
          style={{
            ...styles.input,
            ...(phoneError ? { borderColor: "#e53e3e" } : {})
          }}
          onFocus={e => e.target.style = {
            ...styles.input,
            ...styles.inputFocus,
            borderColor: phoneError ? "#e53e3e" : "#4299e1"
          }}
          onBlur={e => e.target.style = {
            ...styles.input,
            borderColor: phoneError ? "#e53e3e" : "#e2e8f0"
          }}
        />
        {phoneError && <span style={styles.error}>{phoneError}</span>}
        
        <input
          type="password"
          name="password"
          placeholder="Password"
          onChange={handleChange}
          required
          style={styles.input}
          onFocus={e => e.target.style = {...styles.input, ...styles.inputFocus}}
          onBlur={e => e.target.style = styles.input}
        />
        
        <button
          type="submit"
          style={styles.button}
          onMouseEnter={e => e.currentTarget.style = {...styles.button, ...styles.buttonHover}}
          onMouseLeave={e => e.currentTarget.style = styles.button}
        >
          Sign Up
        </button>
      </form>
    </div>
  );
};

export default Signup;
